import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ProjectBank = ({ userId }) => {
    const [projects, setProjects] = useState([]);
    useEffect(() => {
        const fetchProjectBankData = async () => {
            try {
                const response = await axios.get(`http://localhost:8000/students/projectBank/${userId}`);
                setProjects(response.data);
            } catch (error) {
                console.error(error);
            }
        };

        fetchProjectBankData();
    }, [userId]);

    return (
        <div>
            <h1>Project Bank</h1>
            <table>
                <thead>
                    <tr>
                        <th>S.No</th>
                        <th>Project Name</th>
                        <th>Project Description</th>
                        <th>Project Type</th>
                        <th>Project Domain</th>
                        <th>Teacher Name</th>
                        <th>Department</th>
                        <th>Pre-requisites</th>
                        <th>CG Cutoff</th>
                        <th>CG Eligibility</th>
                    </tr>
                </thead>
                <tbody>
                    {projects.map((project, index) => (
                        <tr key={index}>
                            <td>{index + 1}</td>
                            <td>{project.project_name}</td>
                            <td>{project.project_description}</td>
                            <td>{project.project_type}</td>
                            <td>{project.project_domain}</td>
                            <td>{project.teacher_name}</td>
                            <td>{project.department}</td>
                            <td>{project.pre_requisites.join(', ')}</td>
                            <td>{project.cg_cutoff}</td>
                            <td>{project.cg_eligibility}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ProjectBank;
